import React from 'react';
import './Main.css';
import { MdCall } from 'react-icons/md';
import { FaVideo } from 'react-icons/fa';
import { FaBook } from 'react-icons/fa';
import { FaAtom } from 'react-icons/fa';
import upsc_img from './upsc_img.jpg';
import star from './star.jpg';

function UpscSec() {
  return (
  <>
  <h2 class="text-center p-5"><b>UPSC</b> PATHSHALA</h2>
  <div class="container" className="upsc2">
	<h1>Thank you for taking first step towards UPSC Preparation!</h1>
  <div class="row">
	<div class="col-sm-4">
<img src={upsc_img} height="20" width="20" alt="not loading"/>
	</div>
	<div class="col-sm-8">
		<p><b>What's Next?</b></p>
		<p><MdCall/>  You will get a call within 12 hours</p>
		<p><FaVideo/> Don't miss this call.Ask for the Free Demo</p>
		<p><FaBook/>  Attend the demo and experience our teaching methods</p>
		<p><FaAtom/> Ask , if you are eligible for any scholarship or discounts</p>

	</div>
  </div>
  </div>
  <h1  className="our"><b>Our Star Students</b></h1>
	<div class="container" className="upsc3">
		<img src={star} alt="not loading"/>
		<h4>"UPSC Pathshala's coverage of current affairs was something that I found very helpful.It covered everything in General Studies syllabus."</h4>
	</div>
  </>
  );
}

export default UpscSec;
